                                       <p><strong>Tentang UJM</strong></p>
                                       <p style="text-align: justify;"><strong></strong><strong></strong>Untuk meningkatkan mutu, relevansi dan efisiensi layanan UB di era global, maka pengelolaan UB membutuhkan sistem penjaminan mutu yang direalisasikan dengan membentuk Pusat Jaminan Mutu (PJM) pada tahun 2005 di tingkat Universitas. Sebagai bagian dari upaya untuk melaksanakan Sistem Penjaminan Mutu Akademik di tingkat jurusan maka dibentuk sebuah lembaga Unit Jaminan Mutu (UJM) Jurusan Teknik Pengairan berdasarkan SK Dekan Fakultas Teknik yang terdiri dari unsur pimpinan jurusan, dosen, karyawan, dan mahasiswa. Tujuan utama dibentuknya lembaga Unit Jaminan Mutu (UJM) di Jurusan Teknik Pengairan adalah untuk mewujudkan sebuah Sistem Penjaminan Mutu Akademik (SPMA) di Jurusan Teknik Pengairan Fakultas Teknik Universitas Brawijaya, yang diharapkan bisa menjadi pedoman dalam usaha perencanaan dan pelaksanaan akademik, peningkatan sumber daya, prosedur kegiatan dan prosedur evaluasi. Dengan demikian diharapkan dapat dicapai sebuah jaminan kualitas akademik di Jurusan&nbsp; Pengairan sesuai dengan visi, misi dan tujuan pendidikan.</p>
